import back from "../components/Botton/back.vue";
import { apiGetUserInfo } from "@/api/User";
export default {
  components: {
    back: back
  },
  created: function created() {
    this.getuser();
  },
  data: function data() {
    return {
      vip: "",
      url: "",
      ShowExplain: false
    };
  },
  methods: {
    showPopup: function showPopup() {
      this.ShowExplain = true;
    },
    hideExplain: function hideExplain() {
      this.ShowExplain = false;
    },
    getuser: function getuser() {
      var _this = this;

      apiGetUserInfo("", true).then(function (res) {
        _this.vip = res.RankId;
        _this.url = res.UImg;
      });
    }
  }
};
